create table Company_LCIAA (
	id INT,
	company_name VARCHAR(50),
	Address_1 VARCHAR(50),
	address_2 VARCHAR(50),
	City VARCHAR(50),
	State VARCHAR(6),
	Zip_Code VARCHAR(50),
	Phone_Number VARCHAR(50),
	SIC_Code VARCHAR(50),
	Social_Media_Link VARCHAR(50),
	Status VARCHAR(11),
	Company_Webpage VARCHAR(50)
);
